/*  API/getCourses.js
    Robin Marillia

    Recupere les todos depuis un site distant
*/

function getTodos(callback){

    fetch("http://www.mocky.io/v2/5ebab22a3600006100f7e279",{
        headers : { 
            'Content-Type': 'application/json',
            'Accept': 'application/json'
           }
    })
        .then(res => res.json())
        .then(
        (result) => {

            callback(result)
        },

        (error) => {
            console.log(error)
        }
    )
}

export default getTodos
